import React from "react";
import "../stylesheets/Header.css"

function Header() {
  return (
    <header className="header">
      {/* Logo que recarga la página */}
      <a href="/" className="logo">
        <img src="/logo.png" alt="Logo" />
      </a>

      {/* Navegación */}
      <nav className="nav">
        <ul>
          <li>
            <a href="#characters">Characters</a>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
